// SPDX-License-Identifier: MIT
pragma solidity >=0.8.5 <0.9.0;

import "./Modifiers.sol";

contract SafeMath {

    function safeAdd(uint a, uint b) public pure returns (uint c) {
        c = a + b;
        require(c >= a);
    }

    function safeSub(uint a, uint b) public pure returns (uint c) {
        require(b <= a);
        c = a - b;
    }

    function safeMul(uint a, uint b) public pure returns (uint c) {
        c = a * b;
        require(a == 0 || c / a == b);
    }

    function safeDiv(uint a, uint b) public pure returns (uint c) {
        require(b > 0);
        c = a / b;
    }
}


//ERC Token Standard #20 Interface

abstract contract ERC20Interface {
    function totalSupply() public virtual view returns (uint);
    function balanceOf(address tokenOwner) public virtual view returns (uint balance);
    function allowance(address tokenOwner, address spender) public virtual view returns (uint remaining);
    function transfer(address to, uint tokens) public virtual returns (bool success);
    function approve(address spender, uint tokens) public virtual returns (bool success);
    function transferFrom(address from, address to, uint tokens) public virtual returns (bool success);

    event Transfer(address indexed from, address indexed to, uint tokens);
    event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
}

contract WTHB is Modifiers, ERC20Interface, SafeMath {

  string public name = "Water Bear - Thai Baht Stable Coin";
  string public symbol = "wTHB";
  uint256 internal _totalSupply = 0;
  uint8 public decimals = 18;
  mapping(address => uint256) public _balanceOf;
  mapping(address => mapping(address => uint256)) public _allowance;

  constructor() {
  }

  function allowance(address _allower, address _spender) public override view returns(uint256) {
    return _allowance[_allower][_spender];
  }

  function balanceOf(address _address) public override view returns(uint256) {
    return _balanceOf[_address];
  }

  function totalSupply() public override view returns(uint256) {
    return _totalSupply;
  }

  function mint(address _to, uint256 _value) public owneronly returns(bool success) {
    success = false;
    _balanceOf[_to] += _value;
    _totalSupply += _value;
    success = true;
  }

  function transfer(address _to, uint256 _value) public override returns(bool success) {
    success = false;
    require(_balanceOf[msg.sender] >= _value, "Not enough money to transfer");
    _balanceOf[msg.sender] -= _value;
    _balanceOf[_to] += _value;
    emit Transfer(msg.sender, _to, _value);
    success = true;
  }

  function approve(address _spender, uint256 _value) public override returns(bool success) {
    success = false;
    _allowance[msg.sender][_spender] = _value;
    emit Approval(msg.sender, _spender, _value);
    success = true;
  }

  function transferFrom(address _from, address _to, uint256 _value) public override returns(bool success) {
    success = false;
    require(_balanceOf[_from] >= _value);
    require(_allowance[msg.sender][_from] >= _value);
    _balanceOf[_from] -= _value;
    _balanceOf[_to] += _value;
    emit Transfer(_from, _to, _value);
    success = true;
  }
}
